import React from "react";
import background from './Utils/images/rename.jpg'

import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Nav, Navbar } from "react-bootstrap";
import Navi from "./components/Navi";


function App() {
  return (
    <Container fluid='true'>
      <Navi/> 
      <Container style={{height: 'max-height', backgroundImage:`url(${background})`}} id='main-view' fluid='true'>

      </Container>
    </Container>

  );
}

export default App;
